import React from "react";
import Chat from "./components/Chat";

function App() {
  return (
    <div
      className="App"
      style={{
        width: "500px",
        margin: "50px auto",
        fontFamily: "Arial",
        textAlign: "center"
      }}
    >
      <h1
        style={{
          fontSize: "32px",
          fontWeight: "bold",
          color: "#4A00E0"
        }}
      >
        AI Assistant
      </h1>

      <Chat />
    </div>
  );
}

export default App;
